(72846, 1, 18886, '<p>This is to confirm that you just bought {$credits} credits for {$price} {$currency}. It''s exciting what you can do with them in our community!</p>\r\n<p>Thank you for your purchase and have a good day!</p>\r\n<p>Sincerely,<br />\r\n{$site_name} team</p>'),
(72847, 1, 18887, '{$credits} credits purchase'),
(72848, 1, 18888, 'This is to confirm that you just bought {$credits} credits for {$price} {$currency}. It''s exciting what you can do with them in our community!\r\n\r\nThank you for your purchase and have a good day!\r\n\r\nSincerely,\r\n{$site_name} team'),
(72849, 1, 18889, 'Settings'),
(72850, 1, 18890, 'Membership configuration'),
(72851, 1, 18891, 'Notifications'),
(72852, 1, 18892, '<p>Hi {$name},</p>\r\n<p>We are letting you know that your {$membership} membership just expired but don''t let that stop you! You are warmly invited to extend your membership to stay connected in our community and enjoy all of its benefits!</p>\r\n<p>And of course, if you have any questions or concerns, just let us know! We are eagerly willing to help you in any way possible!</p>\r\n<p>Sincerely,<br />\r\n{$site_name} team</p>'),
(72853, 1, 18893, 'Your membership has expired'),
(72854, 1, 18894, 'Hi {$name},\r\n\r\nWe are letting you know that your {$membership} membership just expired but don''t let that stop you! You are warmly invited to extend your membership to stay connected in our community and enjoy all of its benefits!\r\n\r\nAnd of course, if you have any questions or concerns, just let us know! We are eagerly willing to help you in any way possible!\r\n\r\nSincerely,\r\n{$site_name} team'),
(72855, 1, 18895, '<p>Hello there {$name},</p>\r\n<p>We hope you enjoy being a part of our community as much as we do. Here''s a friendly reminder that your {$membership} membership expires in {$days} days, so it may be a good idea to check your preferred payment method to make sure you stay connected.</p>\r\n<p>If you have any concernsor questions, just let us know, we are always there to help!</p>\r\n<p>Sincerely,<br />\r\n{$site_name} team</p>'),
(72856, 1, 18896, 'Your membership expires in {$days} days'),
(72857, 1, 18897, 'Hello there {$name},\r\n\r\nWe hope you enjoy being a part of our community as much as we do. Here''s a friendly reminder that your {$membership} membership expires in {$days} days, so it may be a good idea to check your preferred payment method to make sure you stay connected.\r\n\r\nIf you have any concerns or questions, just let us know, we are always there to help!\r\n\r\nSincerely,\r\n{$site_name} team'),
(72858, 1, 18898, '<p>Hi {$name},</p>\r\n<p>We hope you enjoy being a part of our community as much as we do. Here''s a friendly reminder that your {$membership} membership expires in 24 hours, so it may be a good idea to check your preferred payment method to make sure you stay connected.</p>\r\n<p>If you don’t have a recurring membership set up, you are encouraged to do that to ensure smooth and uninterrupted premium experience that {$membership} membership provides.</p>\r\n<p>If you have any concerns or questions, just let us know, we are always there to help!</p>\r\n<p>Sincerely,<br />\r\n{$site_name} team</p>'),
(72859, 1, 18899, 'Your membership expires in 24 hours'),
(72860, 1, 18900, 'Hi {$name},\r\n\r\nWe hope you enjoy being a part of our community as much as we do. Here''s a friendly reminder that your {$membership} membership expires in 24 hours, so it may be a good idea to check your preferred payment method to make sure you stay connected.\r\n\r\nIf you don’t have a recurring membership set up, you are encouraged to do that to ensure smooth and uninterrupted premium experience that {$membership} membership provides.\r\n\r\nIf you have any concerns or questions, just let us know, we are always there to help!\r\n\r\nSincerely,\r\n{$site_name} team'),
(72861, 1, 18901, '<p>Hi {$name},</p>\r\n<p>Thanks for upgrading! We hope you will enjoy the benefits of your new membership at our site, which will last until {$expirationDate}. If you have any questions, feel free to ask, we are always there for your convenience.</p>\r\n<p>Sincerely,<br />\r\n{$site_name} team</p>'),
(72862, 1, 18902, 'Successful upgrade to {$membership} membership level'),
(72863, 1, 18903, 'Hi {$name},\r\n\r\nThanks for upgrading! We hope you will enjoy the benefits of your new membership at our site, which will last until {$expirationDate}. If you have any questions, feel free to ask, we are always there for your convenience.\r\n\r\nSincerely,\r\n{$site_name} team'),
(72864, 1, 18904, '<p>Hi there {$name},</p>\r\n<p>Your {$membership} membership has just been renewed, since you have a recurring {$membership} membership set up at our site. Thank you for being a part of our community!</p>\r\n<p>And of course, if you have feedback, or any questions/concerns, just let us know!</p>\r\n<p>Sincerely,</br />\r\n{$site_name} team</p>'),
(72865, 1, 18905, 'Your membership has been renewed'),
(72866, 1, 18906, 'Hi there {$name},\r\n\r\nYour {$membership} membership has just been renewed, since you have a recurring {$membership} membership set up at our site. Thank you for being a part of our community!\r\n\r\nAnd of course, if you have feedback, or any questions/concerns, just let us know!\r\n\r\nSincerely,\r\n{$site_name} team'),
