(76135, 1, 19368, 'Welcome to <a href="{$site_url}">{$site_name}</a>! Thanks for joining us. Here are some quick links that you need to find your way around:<br/><br/>\r\n- <a href="{$site_url}">Main page</a><br/>\r\n- <a href="{$site_url}my-profile">Change avatar</a><br/>\r\n- <a href="{$site_url}photo/viewlist/latest">Upload Photos</a><br/>\r\n- <a href="{$site_url}profile/edit">Change profile details</a><br/>\r\n- <a href="{$site_url}users">Look who''s in</a><br/><br/>\r\nFeel free to participate in our community!<br/><br/>\r\n<a href="{$site_url}">{$site_name}</a> administration<br/>'),
(76136, 1, 19369, 'Welcome to {$site_name}! Thanks for joining us. Here are some quick links that you need to find your way around:\r\n\r\n- Main page: {$site_url}\r\n- Change avatar: {$site_url}my-profile\r\n- Upload photos: {$site_url}photo/viewlist/latest\r\n- Change profile details: {$site_url}profile/edit\r\n- Look who''s in: {$site_url}users\r\n\r\nFeel free to participate in our community!\r\n\r\n{$site_name} administration\r\n\r\n{$site_url}'),
(76137, 1, 19370, '<p>\r\nWelcome to our site! Here are a few quick links that you need to start your way around:\r\n</p>\r\n<ul class="ow_regular">\r\n<li><a href="profile/avatar" change_avatar>Change avatar</a></li>\r\n<li><a href="javascript://" photo_upload>Upload photos</a></li>\r\n<li><a href="profile/edit">Change profile details</a></li>\r\n<li><a href="my-profile">Preview/rearrange my profile</a></li>\r\n<li><a href="users">Look who''s in</a></li>\r\n</ul>\r\n\r\n<p>\r\nFeel free to participate in our community!\r\n</p>'),
